    /**
     * can mark
     *
     * @param string $compareDateTime
     * @return bool
     */
    public function canMark(string $compareDateTime): bool
    {
        // get date in utc
        $dateInUTC = getSystemDateInUTC();
        // convert today date to UTC
        $dateInUTCObj = new DateTime($dateInUTC, new DateTimeZone("UTC"));
        // convert copmpare date to UTC
        $compareDateTimeObj = new DateTime($compareDateTime, new DateTimeZone("UTC"));
        // apply difference
        $diff = $dateInUTCObj->diff($compareDateTimeObj);
        // if diference is off one minute
        return $diff->format("%i") >= 1;
    }

    /**
     * get duration between dates in seconds
     *
     * @param string $d1
     * @param string $d2
     * @return array seconds
     */
    public function getDurationInMinutes(string $d1, string $d2): int
    {
        // convert d1 to UTC
        $d1Obj = new DateTime($d1, new DateTimeZone("UTC"));
        // convert d1 to UTC
        $d2Obj = new DateTime($d2, new DateTimeZone("UTC"));
        // apply difference
        $diff = $d2Obj->diff($d1Obj);
        // if diference is off one minute
        return
            $diff->s
            + ($diff->i * 60)
            + ($diff->h * 3600)
            + ($diff->d * 86400)
            + ($diff->m * 2592000)
            + ($diff->y * 31536000);
    }

    /**
     * get the dates within start and end date
     *
     * @param string $startDate
     * @param string $endDate
     * @return array
     */
    public function getDatePoolInRange(string $startDate, string $endDate): array
    {
        // convert d1 to UTC
        $d1Obj = new DateTime($startDate);
        // convert d1 to UTC
        $d2Obj = new DateTime($endDate);
        // set empty date pool
        $datesPool = [];
        //
        while ($d1Obj <= $d2Obj) {
            // add the date to the pool
            $datesPool[$d1Obj->format(DB_DATE)] = 0;
            // add X number of days in todays date
            $d1Obj->modify("+1 day");
        }
        //
        return $datesPool;
    }

    /**
     * get the dates within start and end date
     *
     * @param string $seconds
     * @param bool $doFormat Optional
     * @return array
     */
    public function convertSecondsToHours(string $seconds, bool $doFormat = false)
    {
        // set the object
        $obj = [
            "hours" => (float)number_format($seconds / 3600, 1),
            "minutes" => (float)(($seconds % 3600) / 60),
            "seconds" => (float)($seconds % 60),
        ];
        //
        if ($doFormat) {
            return round($obj["hours"]) . "h " . floor($obj["minutes"]) . "m";
        }
        $obj["totalInnMinutes"] = ((int)$obj["hours"]) * 60;
        $obj["totalInnMinutes"] += $obj["minutes"];
        $obj["totalInnMinutes"] += $obj["seconds"] / 60;
        //
        return $obj;
    }

    /**
     * generates clock entries against a company
     *
     * @param int $companyId
     * @param string $startDate
     * @param string $endDate
     * @return array
     */
    public function generateClockEntries(
        int $companyId,
        string $startDate,
        string $endDate
    ) {
        // get the company employees
        $companyAtiveEmployeeIds = $this->getCompanyActiveEmployeeIds($companyId);
        //
        if (!$companyAtiveEmployeeIds) {
            return ["errors" => ["No employees found."]];
        }
        //
        $processedEmployeesCount = 0;
        // get the dates within range
        $datesRange = getDatesInRange($startDate, $endDate);
        // loop through the data
        foreach ($companyAtiveEmployeeIds as $employeeId) {
            // get the clocks witin date range
            $clockedDatesArray = $this->getEmployeClockedDatesWithinRange(
                $employeeId,
                $startDate,
                $endDate
            );
            //
            $addedRecords = 0;
            // loop through the dates
            foreach ($datesRange as $date) {
                // check if there is already an entry
                if (in_array($date, $clockedDatesArray)) {
                    continue;
                }
                $addedRecords = 1;
                // get the day main array and entries
                $entry = $this->getDayEntryWithLog($date);
                // make insert array
                $ins = $entry["main"];
                $ins["company_sid"] = $companyId;
                $ins["employee_sid"] = $employeeId;
                // insert the data
                $this->CI->db->insert("cl_attendance", $ins);
                // get the last inserted id
                $attendanceId = $this->CI->db->insert_id();
                // failed to insert data
                if (!$attendanceId) {
                    continue;
                }
                //
                foreach ($entry["log"] as $log) {
                    // reset the insert array
                    $ins = $log;
                    $ins["cl_attendance_sid"] = $attendanceId;
                    // insert the data log
                    $this->CI->db->insert("cl_attendance_log", $ins);
                }
            }
            //
            if ($addedRecords) {
                $processedEmployeesCount++;
            }
        }
        //
        return ["success" => "You have successfully added records against " . ($processedEmployeesCount) . " out of " . (count($companyAtiveEmployeeIds)) . " employees."];
    }

    /**
     * generates clock entries against a company
     *
     * @param string $date
     * @return array
     */
    public function getDayEntryWithLog(string $date): array
    {
        //
        $todayDateTime = getSystemDate();
        // get a random clock time
        $time = $this->getRandomTime();
        // set default array
        $entryArray = [
            "main" => [],
            "log" => [],
        ];
        // add the main table data
        $entryArray["main"]["clocked_in"] = $date . " " . $time["start"];
        $entryArray["main"]["clocked_date"] = $date;
        $entryArray["main"]["is_approved"] = 0;
        $entryArray["main"]["created_at"] = $todayDateTime;
        // when end time present
        if (array_key_exists("end", $time)) {
            $entryArray["main"]["last_event"] = "clocked_out";
            $entryArray["main"]["clocked_out"] = $date . " " . $time["end"];
            $entryArray["main"]["last_record_time"] = $entryArray["main"]["clocked_out"];
        } else {
            $entryArray["main"]["last_event"] = "clocked_in";
            $entryArray["main"]["clocked_out"] = null;
            $entryArray["main"]["last_record_time"] = $entryArray["main"]["clocked_in"];
        }
        $entryArray["main"]["updated_at"] = $todayDateTime;
        //
        $entryArray["log"] = [];
        //
        foreach ($time["breakdown"] as $log) {
            // set the log array
            $logArray = [];
            //
            $latLonArray = $this->getRandomLatLon();
            //
            $logArray["lat"] = $latLonArray["lat"];
            $logArray["lng"] = $latLonArray["lng"];
            //
            if ($log[0] === "clocked_in") {
                $logArray["clocked_in"] = $date . " " . $log[1];
                //
                if ($log[2]) {
                    //
                    $latLonArray = $this->getRandomLatLon();
                    //
                    $logArray["lat_2"] = $latLonArray["lat"];
                    $logArray["lng_2"] = $latLonArray["lng"];
                    //
                    $logArray["clocked_out"] = $date . " " . $log[2];
                }
            }
            //
            $logArray["created_at"] = $todayDateTime;
            $logArray["updated_at"] = $todayDateTime;

            $entryArray["log"][] = $logArray;
        }
        //
        return $entryArray;
    }

